import React, { useContext } from "react";
import NextButton from "../NextButton/NextButton";
import { ProgressContext } from "../../contexts/ProgressContext";

const Page6 = (props) => {
  const { adress, setAdress } = useContext(ProgressContext);
  return (
    <div>
      <div className="pageSixContent">
        <h2>Ou habitez-vous ?</h2>
        <input type="text" placeholder="Montreuil, Paris ..." onChange={(event) => setAdress(adress = event.target.value)}/>
      </div>
      <NextButton />
    </div>
  );
};

export default Page6;
